import React from 'react'
import "./primaryButton.scss"
import "./secondaryButton.scss"

export default function Button(props) {

    return (
        <div>
            <button className={props.styleName}>
                <div className="button-container">
                    {props.children}
                    <span>{props.text}</span>
                </div>
            </button>
        </div>
    )
}
